def gerar_codigo_ofuscado():
    codigo = "print('Executando c√≥digo ofuscado!')"
    compilado = compile(codigo, '<string>', 'exec')
    serializado = marshal.dumps(compilado)
    comprimido = zlib.compress(serializado)
    codificado = base64.b64encode(comprimido).decode('utf-8')
    padding = '=' * (4 - len(codificado) % 4)
    codificado += padding
    return codificado

