    chatbot = Chatbot(cookie_path="cookie.json")

    # Obtendo os dados da API
    dados = chatbot.obter_dados_da_api(url_da_api)

    # Executando a an√°lise de hist√≥rico
    stats, data = chatbot.history_stats(dados, parse_samples=100)

    # Exibindo os resultados
    print("Estat√≠sticas de Hist√≥rico:", stats)
    print("Dados de Hist√≥rico:", data)
